import React from 'react'
import './ImageList.css'

export default function ImageList({images}) {
    const img = images.map(({description, id, urls})=>{
        return <img alt={description} key={id} src={urls.regular} />
    })
    return (
        <div className="image-list">
            {img}
        </div>
    )
}
